# Simple rule-based POS tagger for English
words = text.split()
tagged = []
for word in words:
    word_lower = word.lower().strip('.,!?;:')

    # Determiners
    if word_lower in ['the', 'a', 'an', 'this', 'that', 'these', 'those', 'my', 'your', 'his', 'her', 'its', 'our', 'their']:
        tag = 'DT'
    # Pronouns
    elif word_lower in ['i', 'you', 'he', 'she', 'it', 'we', 'they', 'me', 'him', 'her', 'us', 'them']:
        tag = 'PRP'
    # Verbs (common ones)
    elif word_lower in ['is', 'are', 'was', 'were', 'am', 'be', 'been', 'being']:
        tag = 'VBZ' if word_lower in ['is'] else 'VBP' if word_lower in ['are', 'am'] else 'VBD' if word_lower in ['was', 'were'] else 'VB'
    elif word_lower in ['have', 'has', 'had', 'having']:
        tag = 'VBZ' if word_lower == 'has' else 'VBD' if word_lower == 'had' else 'VBG' if word_lower == 'having' else 'VBP'
    elif word_lower in ['do', 'does', 'did', 'doing']:
        tag = 'VBZ' if word_lower == 'does' else 'VBD' if word_lower == 'did' else 'VBG' if word_lower == 'doing' else 'VBP'
    # Prepositions
    elif word_lower in ['in', 'on', 'at', 'by', 'for', 'with', 'from', 'to', 'of', 'about', 'under', 'over']:
        tag = 'IN'
    # Conjunctions
    elif word_lower in ['and', 'or', 'but', 'so', 'yet', 'for', 'nor']:
        tag = 'CC'
    # Adjectives (common ones)
    elif word_lower in ['good', 'bad', 'big', 'small', 'new', 'old', 'young', 'happy', 'sad', 'beautiful', 'ugly']:
        tag = 'JJ'
    # Adverbs
    elif word_lower.endswith('ly'):
        tag = 'RB'
    # Past tense verbs
    elif word_lower.endswith('ed'):
        tag = 'VBD'
    # Present participle/gerunds
    elif word_lower.endswith('ing'):
        tag = 'VBG'
    # Plural nouns
    elif word_lower.endswith('s') and not word_lower.endswith('ss'):
        tag = 'NNS'
    # Numbers
    elif word.isdigit():
        tag = 'CD'
    # Default to noun
    else:
        tag = 'NN'

    tagged.append((word, tag))

return tagged

